import Togglable from './Togglable'

const Blog = ({ blog, toggleDetails }) => {
  const blogStyle = {
    paddingTop: 10, 
    paddingLeft: 2, 
    border: 'solid', 
    borderWidth: 1, 
    marginBottom: 5
  }

  const togglableStyle = {
    display: 'inline'
  }

  return (
    <div style={blogStyle}>
      {blog.title} by {blog.author} 
      <Togglable style={togglableStyle} buttonLabel="view">
        <div>{blog.url}</div>
        <div>likes {blog.likes}</div>
        <div>{blog.user.name}</div>
      </Togglable>  
    </div>  
  )
}

export default Blog
